import React, {Component} from 'react';
import './App.css';
import Homepage from './Pages/Homepage';
import Header from "./Components/Header";
import TopChartsPage from './Pages/TopChartsPage';
import ReviewPage from './Pages/ReviewPage';
import ProfilePage from './Pages/ProfilePage';
import SearchPage from './Pages/SearchPage'; 
import {HashRouter as Router, Switch, Route } from 'react-router-dom'; 


class App extends Component {
    constructor(props) {
        super(props);
        this.state = {
            highestrated: [],

            trending: []
        };


    }

    getNames() {
        fetch('http://18.206.168.148:5000/movies/highestrated ').then(response => response.json()).then(response => {
            this.setState({highestrated: response})
            console.log(this.state)
        })
    }


    getTrending() {
        fetch('http://18.206.168.148:5000/movies/trending ').then(response => response.json()).then(response => {
            this.setState({trending: response})
            console.log(this.state)
        })
    }


    componentDidMount() {
        this.getNames();
        this.getTrending();
    }

    render() {
        return (
            <div className="App">

                <Header></Header>


                <Switch>

                    <Route path="/" exact
                        component={Homepage}/>
                    <Route path="/search"
                        component={SearchPage}/>

                    <Route path="/topcharts"
                        component={TopChartsPage}/>
                    <Route path="/review"
                        component={ReviewPage}/>
                    <Route path="/profile"
                        component={ProfilePage}/>

                </Switch>


            </div>
        );
    }
}

export default App;
